import React from "react";
import {Container, Row, Col} from 'react-bootstrap';
import '../CSS/Footer.css';
import Logos from "../Images/Logos.png";
import {Link} from "react-router-dom";

function Footer() {
    return (
        <>

        <Container className="c footer" fluid>
    <Row>
        <Col>
            <img src={Logos} width="200" height="200" alt="logo" style={{borderRadius:"15px 15px 15px 15px"}}/>
        </Col>
        <Col>
            <Link to="/"><Row>Home</Row></Link>
            <Link to="https://datanecdotes-psb.herokuapp.com/"><Row style={{paddingTop:"1vw"}}>Search</Row></Link>
            <Link to="/Stories"><Row style={{paddingTop:"1vw"}}>Stories</Row> </Link>
            <Link to="/ContactUs"><Row style={{paddingTop:"1vw"}}>Contact Us</Row></Link>
        </Col>
        <Col>
            <Col>Follow Us</Col>
            <Col style={{paddingTop:"1vw"}}><img src="https://img.icons8.com/fluent/64/000000/instagram-new.png" width="5%" /> </Col>
            <Col style={{paddingTop:"1vw"}}><img src="https://img.icons8.com/color/48/000000/twitter.png" width="5%"/> </Col>
            <Col style={{paddingTop:"1vw"}}><img src="https://img.icons8.com/cute-clipart/64/000000/github.png" width="5%"/></Col>
        </Col>
    </Row>


        </Container>

        </>
    );
}
export default Footer;
